import React, { useState } from "react";
import { IoLogoFreebsdDevil } from 'react-icons/io';
import { HiX } from 'react-icons/hi';
import { FaBars, FaReact } from 'react-icons/fa';
import { Link } from 'react-router-dom';

const data = [
    {
        label: 'HOME',
        to: '/'
    },
    {
        label: 'ABOUT',
        to: '/about'
    },
    {
        label: 'PROJECTS',
        to: '/projects'
    },
    {
        label: 'CONTACT',
        to: '/contact'
    }

]

const Navbar = () => {
    const [toggleIcon, setToggleIcon] = useState(false);
    const handleToggleIcon = () => {
        setToggleIcon((prev) => !prev)
    }
    return (
        <div>
            <nav className="navbar">
                <div className="navbar-container">
                    <Link to={'/'} className="navbar-container-logo">
                        <IoLogoFreebsdDevil size={30} />
                    </Link>
                </div>
                <ul className="navbar-container-menu">
                    {
                        data.map((item, key) => (
                            <li key={key} className="navbar-container-menu-item">
                                <Link className="navbar-container-menu-item-links" to={item.to}>
                                    {item.label}
                                </Link>
                            </li>
                        ))
                    }


                </ul>
                <div className="nav-icon" onClick={handleToggleIcon}>
                    {
                        toggleIcon ? <HiX size={30} /> : <FaBars size={30} />
                    }
                </div>
            </nav>
        </div>
    )
}
export default Navbar
